Sociopolitical Documentary hosted by Lucy Briers, published by Channel 4 in 2014 - English narration


Information
------------------------------

The Virgin Killer
Last month, British-born Elliot Rodger murdered six students and injured 13 in nine locations across Santa Barbara, California. The rampage began when he stabbed three of his housemates to death. Leaving the scene in his car, the 22-year-old fired at people around the university town of Isla Vista. Just a day earlier, Rodger had posted videos on the internet in which he outlined details of the attack and the motivations behind it. This documentary examines the tragic events of May 23 and those leading up to it

